import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the "List View" button
    const listViewButtonLocator = page.locator('button[title="List View"]');
    await listViewButtonLocator.waitFor({ state: 'visible', timeout: 5000 });
    await listViewButtonLocator.click();

    // Take a screenshot after clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_list_view_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_list_view_selected.png'));

    // Extract data to verify the view mode changed
    const listViewButtonClass = await listViewButtonLocator.getAttribute('class');
    const isListViewActive = listViewButtonClass.includes('active');

    return {
      success: true,
      action: "Switched to List View Mode by clicking the list view button.",
      extractedData: {
        isListViewActive: isListViewActive,
        listViewButtonClass: listViewButtonClass
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to List View Mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
